1. Editing Hex Data

Hex Data contains raw data pasted into an application written in compiled code. It's possible to write a script that manipulates or changes the hex code to alter the application in a way that isn't recognized by the antivirus. This technique is used most often for ransomware. 

2. Use of Obfuscation

Using obfuscation to syntactically 'uglify' code makes it difficult to discern, which helps code to bypass antivirus programs. Some popular shell coding techniques include Arithmetic Operators and Polymorphing.

3. Load Into Memory Via Process Hollowing

Process hollowing refers to a technique used to load malicious code into the memory of a legitimate, running process. This technique is similar to process injection, but allows new code to not only gain access (and protector level) with other system processes, but also simultaneously replaces any code present in the target process.

